import React from 'react';

// RESULTS VIEW 
// DISPLAYS LIST ITEMS FROM PASSED INFO FROM RANDOM VIEW OR CUSTOM VIEW
// HAS A HEADER WITH THE LOGO AND NAME
// DISPLAYS TEXT WITH LOCATION DISPLAYED

// EXPECTS: LOCATION, ITEMS, MODE THAT IS SELECTED

const results = ({ location }) => {
  return (
    <div>
      <h1>Results</h1>
      <h2>{location}</h2>
    </div>
  );
};

export default results;
